@astcell Microsoft phone? Nokia? Blackberry?
It's like adding a 3rd party to the US 2 party political system: neither party wants a third party to take voters.
Any new popular 3rd party idea that threatens to add 3rd party leads to lip-service of popular idea in 2 parties, but no support.

